import React, { Component } from 'react';
import './css/Navigation.css';

export default class Navigation extends Component {
    render() {
    return (
        <ul className="Navigation">
            <li className="NavigationCities">
              Kyiv
            </li>
            <li className="NavigationCities">
              Lisbon
            </li>
            <li className="NavigationCities">
              Paris
            </li>
            <li className="NavigationCities">
              San Francisco
            </li>
      </ul>
    );
    }
}
